import React, {Component} from 'react';

class Blog extends Component {
    constructor(props) {
        super(props);
        this.state = {
            id: null,
            title: null
        }
    }

    componentDidMount() {
        let id = this.props.match.params.blog_id;
        let title;
            if (id === 1) {
                console.log("true");
                title = "Why do we wake up early?";
            }
        this.setState({
            id: id,
            title: title
        })
    }
    
    render() {
            return (
                <div className="blogs">
                    <h1>{this.state.title}</h1>
                </div>
            )

    }
}

export default Blog;
